import { Box } from '@mui/material'
import React from 'react'
import logoImg from "../media/pngsp1.png"


const Footers = () => {



  return (
    <Box>
      <Box>
      <NavbarLogos src={logoImg} alt="logo" />
      </Box>
    </Box>
  )
}

export default Footers
